import React from 'react';

import classes from './Cars.module.css';

const Cars = (props) => {

    

  return (
    <div className="cars-list">
      <ul>
      {props.userCars.map((cars, pos) => {
        return <li>{cars.brand}</li>
    })}
      </ul>
    </div>
  );
};

export default Cars;
